import React, { Component } from "react";
import {Link} from "react-router-dom";
import Dropdown from "../aPropos/aPropos";
import "./accueil.css";
import Data from "./data.json"

function Article (props) {

    const appartements = Data
    const listAppartements = appartements.map((appartement) =>
        <li key={appartement.id}>
            {appartement}
        </li>
    )

    return (
        <Link to={appartements[0].id}>
            <div id="article">
                <Dropdown />
                <ul>
                    {listAppartements}
                </ul>
                <p id="article__title">{appartements[0].title}</p>
            </div>
        </Link>
    )
}

export default class Accueil extends Component{

    render() {
        const appartements = Data

        return (
        <div id="articles">
            <Article appartements={appartements}/>
        </div>
        )
    }
}
